import Vue from 'vue'
Vue.component("HomeLayout", () => import("/var/www/html/git/vuepressCMS/docs/.vuepress/components/HomeLayout.vue"))
Vue.component("PostLayout", () => import("/var/www/html/git/vuepressCMS/docs/.vuepress/components/PostLayout.vue"))
Vue.component("PostList", () => import("/var/www/html/git/vuepressCMS/docs/.vuepress/components/PostList.vue"))

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/README.md").then(comp => {
        Vue.component("page-index", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    path: "/categories/travel.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/categories/travel.md").then(comp => {
        Vue.component("page-categories-travel", comp.default)
        next()
      })
    }
  },
  {
    path: "/hello.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/hello.md").then(comp => {
        Vue.component("page-hello", comp.default)
        next()
      })
    }
  },
  {
    path: "/hello1.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/hello1.md").then(comp => {
        Vue.component("page-hello1", comp.default)
        next()
      })
    }
  },
  {
    path: "/hello2.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/hello2.md").then(comp => {
        Vue.component("page-hello2", comp.default)
        next()
      })
    }
  },
  {
    path: "/hello3.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/hello3.md").then(comp => {
        Vue.component("page-hello3", comp.default)
        next()
      })
    }
  },
  {
    path: "/hello4.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/hello4.md").then(comp => {
        Vue.component("page-hello4", comp.default)
        next()
      })
    }
  },
  {
    path: "/test.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/test.md").then(comp => {
        Vue.component("page-test", comp.default)
        next()
      })
    }
  },
  {
    path: "/welcome.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/var/www/html/git/vuepressCMS/docs/welcome.md").then(comp => {
        Vue.component("page-welcome", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
